package com.example.airlines.presentation.airlines.list

import android.os.Handler
import androidx.lifecycle.MutableLiveData
import androidx.lifecycle.ViewModel
import com.example.airlines.presentation.airlines.list.models.Airline
import com.example.airlines.presentation.common.BaseViewModelFactory
import com.example.airlines.presentation.common.State

class AirlineListViewModelFactory : BaseViewModelFactory<AirlineListViewModel>(
    AirlineListViewModel()
)

class AirlineListViewModel: ViewModel() {
    val state = MutableLiveData<State<List<Airline>>>()

    fun getAirlineList() {
        state.postValue(State.Loading)

        Handler().postDelayed({
            state.postValue(State.Success(buildList()))
        }, 3000)
    }
}

fun AirlineListViewModel.buildList(): List<Airline> {
    val airlineList = arrayListOf<Airline>()
    airlineList.add(
        Airline(
            "Emirates",
            "data:image/png;base64,"
        )
    )
    airlineList.add(
        Airline(
            "Gol",
            "https://www.guide.com.br/wp-content/uploads/2021/03/0DZ4Y_4S.jpg"
        )
    )
    airlineList.add(
        Airline(
            "VARIG",
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS9ZUodYJD1pOiM_h_E1Lel3kaATQoFHf6JHw&usqp=CAU"
        )
    )
    airlineList.add(
        Airline(
            "TAM",
            "data:image/jpeg;base64,"
        )
    )
    airlineList.add(
        Airline(
            "Azerbaijan",
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTL7F2-WFfbInSuy1u3xqFBjixdfMSoUmKUvA&usqp=CAU"
        )
    )
    airlineList.add(
        Airline(
            "Qatar",
            "data:image/jpeg;base64,"
        )
    )
    return airlineList
}